db.patients.aggregate([ 
    { $lookup: { from: "organizations", localField: "ENCOUNTERS.ORGANIZATION_REF", foreignField: "_id", as: "orgs" } }, 
    { $unwind: "$orgs" }, 
    { $match: { "orgs.NAME": "LEOMINSTER COMUNITY HEALTH CENTER" } }, 
    { $project: { _id: 0, FIRST: 1, LAST: 1 } } 
])
